export default interface Job {
  /**
   * The prefix for the vocabulary, must be a valid qualified name (#x9 | #xA | #xD | #x20).
   */
  prefix: string

  /**
   * The Iri namespace for the vocabulary.
   */
  iri: string

  /**
   * The name of the account in TriplyDB.com that publishes the vocabulary.
   */
  account: string

  /**
   * The name of the dataset in TriplyDB.com, if this is different from the job alias.
   */

  dataset?: string
  /**
   * If the vocabulary alias cannot act as an object name in TypeScript, specify a different object name.
   *
   * For example, `void` is a keyword in TypeScript, so the object name is
   * set to `VoID` instead.
   */
  objectName?: string
}
